import React from 'react';
import Button from './Button';

const soundscapeOptions = ['Music', 'Nature', 'Rain', 'Celestial', 'Beach', 'Chimes', 'Storm', 'White Noise'];

const Soundscape = () => {
  return (
    <div className="quadrant">
      <h2>Soundscape</h2>
      <div className="option-grid">
        {soundscapeOptions.map(option => (
          <Button key={option} text={option} />
        ))}
      </div>
    </div>
  );
};

export default Soundscape;
